const defaultState = {
  email: "example@example.com",
  password: "",
};

function reducer(state = defaultState, actions) {
  switch (actions.type) {
    case "email":
      return { ...state, email: actions.payload.email };

    case "password":
      return { ...state, password: actions.payload.password };

    default:
      return state;
  }
}

export default reducer;
